import React from "react";

function LoginPage() {
  return (
    <div className="login-page-container">
      <Nav />
      <div className="main-section-background">
        <div id="background-item1"></div>
        <div id="background-item2"></div>
      </div>
    </div>
  );
}

export default LoginPage;
